import React, { Component } from 'react';
import './Todo.css';

class Todo extends Component {
	
	constructor(props){
		super(props)
		this.state = {
			length: 1,
			jobs: [
				<input type="text" placeholder="" className="inp"/>
			]
		}
	}
	
	addElement = () => {
		const jobs1 = this.state.jobs;
		jobs1.push(<input type="text" className='inp'/>);
		this.setState({jobs: jobs1});
		console.log(this.state.jobs);
	}
	
	render() {
		return(
			<div>
				<div className='jobsList'>
					{this.state.jobs}
					<div className='add mt3 dib bw2 grow shadow-5' onClick={this.addElement}>
						<p className='f2 mt0'>+</p>
					</div>
				</div>
				<div className='float dib bw2 grow shadow-5' onClick={() => {this.props.onRouteChange('timeTable')}}>
					<p className='my-float'>Time-Table</p>
				</div>
			</div>
		);
	}
}

export default Todo;
